ISLAMABAD, Sep 16 (APP):Ambassador of United Arab Emirates (UAE) Hamad Obaid Ibrahim Salam Al-Zaabi on Thursday called on Minister for Defence Production Zobaida Jalal here and discussed matters of mutual interest.
Minister for Defence Production presented a souvenir to Ambassador Hamad Obaid Ibrahim Salam Al-Zaabi on the occasion, said a brief media release.
